import React from "react";
import * as appStyle from "./App.module.css";

function App() {
  return (
    <React.Fragment>
      <div class={appStyle.container}>
        <h1 class={appStyle["text-center"]}>SHHH! Yahan Ana mana hai</h1>
        <div class={appStyle["button-group"]}>
          <button class={appStyle.btn}>Add Secret Message</button>
          <button class={appStyle.btn}>See All Secret Messages</button>
          <button class={appStyle.btn}>Find Secret Message</button>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
